import React from 'react';

function FruitList() {
  // 배열 데이터
  const fruits = ['Apple', 'Banana', 'Orange', 'Mango'];

  // JSX 변수
  const elements = fruits.map((fruit, index) => (
    <li key={index}>{fruit}</li>
  ));

  return (
    <div>
      <h1>Fruit List</h1>
      {/* JSX 변수 출력 */}
      <ul>{elements}</ul>
    </div>
  );
}

export default FruitList;
